import React from "react";

function Header(props) {
  return (
    <>
      <img src="../public/logo.png" alt="" />
      <header className="header">
        <img src="../public/logo.png" alt="" />
        <h2>Youtube</h2>
      </header>
    </>
  );
}

export default Header;
